  describe('[1023] 숫자 1개 입력받아 부분별로 출력하기', () => {
    it('정수 부분과 실수 부분으로 나누어 반환한다', () => {
      // when
      const [integer, realNumber] = sut.getSeparateNumber(1.414213);

      // then
      expect(integer).toBe(1);
      expect(realNumber).toBe(414213);
    });

    it('절대값 10000을 넘기면 에러가 발생한다', () => {
      expect(() => sut.getSeparateNumber(12345.678)).toThrow(
        new Error(
          '유효하지 않은 입력입니다. 절대값은 10000을 넘을 수 없습니다',
        ),
      );
    });
  });

